//THE MINIFIED VERSION IS WHAT YOU WOULD UPLOAD TO THE FORM
class Random{constructor(){this.useA=!1;let sfc32=function(uint128Hex){let a=parseInt(uint128Hex.substr(0,8),16),b=parseInt(uint128Hex.substr(8,8),16),c=parseInt(uint128Hex.substr(16,8),16),d=parseInt(uint128Hex.substr(24,8),16);return function(){a|=0,b|=0,c|=0,d|=0;let t=(a+b|0)+d|0;return d=d+1|0,a=b^b>>>9,b=c+(c<<3)|0,c=c<<21|c>>>11,c=c+t|0,(t>>>0)/4294967296}};this.prngA=new sfc32(inputData.hash.substr(2,32)),this.prngB=new sfc32(inputData.hash.substr(34,32));for(let i=0;i<1e6;i+=2)this.prngA(),this.prngB()}random_dec(){return this.useA=!this.useA,this.useA?this.prngA():this.prngB()}random_num(a,b){return a+(b-a)*this.random_dec()}random_int(a,b){return Math.floor(this.random_num(a,b+1))}random_bool(p){return this.random_dec()<p}random_choice(list){return list[this.random_int(0,list.length-1)]}}function setup(){let aspectRatio=1.35,dp=window.devicePixelRatio,ih=window.innerHeight*dp,iw=window.innerWidth*dp;ih/iw<1.35?(canvas.height=ih,canvas.width=ih/1.35):(canvas.width=iw,canvas.height=1.35*iw),document.body.appendChild(canvas)}function draw(){let ctx=canvas.getContext("2d"),R=new Random,color="#"+Math.floor(16777215*R.random_dec()).toString(16).toString(),startX=canvas.width*R.random_dec(),startY=canvas.height*R.random_dec(),endX=canvas.width*R.random_dec(),endY=canvas.height*R.random_dec(),lineWidth=.05*canvas.width;ctx.fillStyle="#fff",ctx.fillRect(0,0,canvas.width,canvas.height),ctx.strokeStyle=color,ctx.lineWidth=lineWidth,ctx.moveTo(startX,startY),ctx.lineTo(endX,endY),ctx.stroke(),ctx.rect(0,0,canvas.width,canvas.height),ctx.stroke()}let canvas=document.createElement("canvas");setup(),draw();